import Cities from './cities.json';

function Table() {

    return(
        <div>
        <div>
        {Cities.map(function data(d) {
         return(
             <div >
                 <h1>{d.citie}  </h1>
                 <h2>{d.peples}  </h2>
             </div>
         )   
        })}
        </div>
        </div>
    )
    
}
export default Table;
